import React, { Component } from "react";
import Header from "./Header";

class MainPage extends Component {
  state = {
    score: 0,
    topScore: 0
  };

  pointIncrease = () => {
    this.setState({ count: this.state.count + 1 });
  };

  render() {
    return (
      <Header>
      </Header>
    );
  };

}
export default MainPage;
